    >>> round(find_zero([-6, 11, -6, 1]), 2) # (x - 1) * (x - 2) * (x - 3) = -6 + 11x - 6x^2 + x^3
    1.0
    """
    assert len(xs) % 2 == 0, 'Number of coefficients must be even'
    n = len(xs) // 2
    def poly(x):
        return sum([coeff * pow(x, i) for i, coeff in enumerate(xs[:n+1])])
    def deriv(x):
        return sum([coeff * i * pow(x, i-1) for i, coeff in enumerate(xs[n+1:])])
    left, right = -1, 1
